<?php
$aes_key = base64_decode('SP4n+Eg0+AEnxgAhlwGQxmGjzxNIgeP+ZjCliYQzkrc=');
$encrypted_data = base64_decode('');
$nonce_size = 12;
$nonce = substr($encrypted_data, 0, $nonce_size);
$tag_size = 16;
$encrypted_content = substr($encrypted_data, $nonce_size, -$tag_size);
$tag = substr($encrypted_data, -$tag_size);
$decrypted_data = openssl_decrypt($encrypted_content, 'aes-256-gcm', $aes_key, OPENSSL_RAW_DATA, $nonce, $tag);
